text:
@regran_ed from @whywomendontleave -  it's easy to fall in love with a illusion.  narcissist are so great at playing the role as the "perfect" person. they come a cross as being "too good  to be true" because they are. i am a firm believer in actions speak louder than words. watch what someone does, not what they say. abusers will promise you everything under the sun. they're sorry, it will never happen again, they didn't mean it, you made them do it. etc. i remember so clearly being in court with my husband. he was trying to justify why he was posting nasty and inappropriate things about me online to the judge. at one point he is practically screaming "but i love her!!!" that moment will forever stay with me. i remember watching the people's reactions in the court room. everyone was in shock and clearly uncomfortable.  it suddenly became crystal clear that his words meant nothing to everyone in the court room. they all say him for what he was. a manipulative abuser. who had been telling me whatever i wanted to hear and then turning around and doing whatever he wanted to do. that moment changed me. i remember thinking "omg! this isn't love. he thinks he owns me, if i go back, he will kill me"

actions count, words don't.  pay attention and don't get lost in the early stages of falling in love. because those days don't last forever but the effects of abuse can. 
#whywomendontleave #domesticabuse #complexptsd #domesticviolence #dv #violenceagainstwomen #narcissist#standup#nomore #ptsd#metoo#takeastand#violenceeffectseveryone#actionsnotwords#redflags - #regrann

